    std::cout << " . . .\n\n";

    // Pure Activation, layer 7
    static std::array<Scalar, 3200> layer_7_output;
    for (int i = 0; i < 3200; ++i) {
        silu(layer_7_output[i], layer_6_output[i], 0.0);
    }

    // DEBUGGING, 1st 10 values of Activation layer 7:
    std::cout << "(Activation) layer 7:" << "\n";
    std::cout << "Shape -> ";
    std::cout << "(50, 64)" << "\n";
    std::cout << "Values -> ";
    for (int ii = 0; ii < 10; ++ii) {
        std::cout << layer_7_output[ii];
        if (ii < 10 - 1) std::cout << ", ";
    }
    std::cout << " . . .\n\n";

    // BatchNormalization, layer 8
    static std::array<Scalar, 3200> layer_8_output;
    BatchNormalization_cnn_1d<Scalar, 64, 50>(
        layer_8_output.data(), layer_7_output.data(),
        gamma_8.data(), beta_8.data(),
        mean_8.data(), variance_8.data(),
        epsilon_8);

    // DEBUGGING, 1st 10 values of BatchNormalization layer 8:
    std::cout << "(BatchNormalization) layer 8:" << "\n";
    std::cout << "Shape -> ";
    std::cout << "(50, 64)" << "\n";
    std::cout << "Values -> ";
    for (int ii = 0; ii < 10; ++ii) {
        std::cout << layer_8_output[ii];
        if (ii < 10 - 1) std::cout << ", ";
    }
    std::cout << " . . .\n\n";

    // MaxPooling1D, layer 9
    static std::array<Scalar, 1600> layer_9_output;
    MaxPooling1D_cnn_1d<Scalar, 2, 2>(
        layer_9_output.data(), layer_8_output.data(), 50, 64);

    // DEBUGGING, 1st 10 values of MaxPooling1D layer 9:
    std::cout << "(MaxPooling1D) layer 9:" << "\n";
    std::cout << "Shape -> ";
    std::cout << "(25, 64)" << "\n";
