    std::cout << " . . .\n\n";

    // SeparableConv1D, layer 10
    static std::array<Scalar, 2400> layer_10_output;
    SeparableConv1D_cnn_1d<Scalar, 96, 25>(
        layer_10_output.data(), layer_9_output.data(),
        sepDepthwise_10.data(), sepPointwise_10.data(), sepPointwiseBias_10.data(),
        64, 25, 3, 1, 1,
        silu, 0.0);

    // DEBUGGING, 1st 10 values of SeparableConv1D layer 10:
    std::cout << "(SeparableConv1D) layer 10:" << "\n";
    std::cout << "Shape -> ";
    std::cout << "(25, 96)" << "\n";
    std::cout << "Values -> ";
    for (int ii = 0; ii < 10; ++ii) {
        std::cout << layer_10_output[ii];
        if (ii < 10 - 1) std::cout << ", ";
    }
    std::cout << " . . .\n\n";

    // BatchNormalization, layer 11
    static std::array<Scalar, 2400> layer_11_output;
    BatchNormalization_cnn_1d<Scalar, 96, 25>(
        layer_11_output.data(), layer_10_output.data(),
        gamma_11.data(), beta_11.data(),
        mean_11.data(), variance_11.data(),
        epsilon_11);

    // DEBUGGING, 1st 10 values of BatchNormalization layer 11:
    std::cout << "(BatchNormalization) layer 11:" << "\n";
    std::cout << "Shape -> ";
    std::cout << "(25, 96)" << "\n";
    std::cout << "Values -> ";
    for (int ii = 0; ii < 10; ++ii) {
        std::cout << layer_11_output[ii];
        if (ii < 10 - 1) std::cout << ", ";
    }
    std::cout << " . . .\n\n";

    // Conv1D, layer 12
    static std::array<Scalar, 3200> layer_12_output;
    Conv1D_cnn_1d<Scalar, 128, 25>(
        layer_12_output.data(), layer_11_output.data(),
        convKernel_12.data(), convBias_12.data(),
        96, 25, 3, 1, 1,
        tanhCustom, 0.0);

    // DEBUGGING, 1st 10 values of Conv1D layer 12:
    std::cout << "(Conv1D) layer 12:" << "\n";
    std::cout << "Shape -> ";
    std::cout << "(25, 128)" << "\n";
    std::cout << "Values -> ";
    for (int ii = 0; ii < 10; ++ii) {
        std::cout << layer_12_output[ii];
        if (ii < 10 - 1) std::cout << ", ";
    }
    std::cout << " . . .\n\n";

    // BatchNormalization, layer 13
    static std::array<Scalar, 3200> layer_13_output;
    BatchNormalization_cnn_1d<Scalar, 128, 25>(
        layer_13_output.data(), layer_12_output.data(),
        gamma_13.data(), beta_13.data(),
        mean_13.data(), variance_13.data(),
        epsilon_13);

    // DEBUGGING, 1st 10 values of BatchNormalization layer 13:
    std::cout << "(BatchNormalization) layer 13:" << "\n";
    std::cout << "Shape -> ";
    std::cout << "(25, 128)" << "\n";
    std::cout << "Values -> ";
    for (int ii = 0; ii < 10; ++ii) {
        std::cout << layer_13_output[ii];
        if (ii < 10 - 1) std::cout << ", ";
    }
    std::cout << " . . .\n\n";

    // MaxPooling1D, layer 14
    static std::array<Scalar, 1536> layer_14_output;
    MaxPooling1D_cnn_1d<Scalar, 2, 2>(
        layer_14_output.data(), layer_13_output.data(), 25, 128);

    // DEBUGGING, 1st 10 values of MaxPooling1D layer 14:
    std::cout << "(MaxPooling1D) layer 14:" << "\n";
    std::cout << "Shape -> ";
    std::cout << "(12, 128)" << "\n";
    std::cout << "Values -> ";
    for (int ii = 0; ii < 10; ++ii) {
        std::cout << layer_14_output[ii];
        if (ii < 10 - 1) std::cout << ", ";
    }
    std::cout << " . . .\n\n";

    // Conv1DTranspose, layer 15
    static std::array<Scalar, 1536> layer_15_output;
    Conv1DTranspose_cnn_1d<Scalar, 64, 24>(layer_15_output.data(),                         
		layer_14_output.data(),                         
		convKernel_15.data(),                         
		convBias_15.data(),
		128, 12, 3, 2, 0, linear, 0.0);

    // DEBUGGING, 1st 10 values of Conv1DTranspose layer 15:
    std::cout << "(Conv1DTranspose) layer 15:" << "\n";
    std::cout << "Shape -> ";
    std::cout << "(24, 64)" << "\n";
