    std::cout << " . . .\n\n";

    // Dense, layer 18
    static std::array<Scalar, 256> layer_18_output;
    Dense_cnn_1d<Scalar, 256>(
        layer_18_output.data(), layer_17_output.data(),
        weights_18.data(), biases_18.data(),
        64, linear, 0.0);

    // DEBUGGING, 1st 10 values of Dense layer 18:
    std::cout << "(Dense) layer 18:" << "\n";
    std::cout << "Shape -> ";
    std::cout << "(256)" << "\n";
    std::cout << "Values -> ";
