    std::cout << " . . .\n\n";

    // Dense, layer 21
    static std::array<Scalar, 128> layer_21_output;
    Dense_cnn_1d<Scalar, 128>(
        layer_21_output.data(), layer_19_output.data(),
        weights_21.data(), biases_21.data(),
        256, gelu, 0.0);

    // DEBUGGING, 1st 10 values of Dense layer 21:
