    std::cout << " . . .\n\n";


//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\// 


    static std::array<Scalar, 10> model_output;

    for (int i = 0; i < 10; i++) { model_output[i] = (layer_23_output[i] * output_scale[i]) + output_shift[i]; }

